var logo_base64 = `data:image/svg+xml;base64,`; 
var women_logo = `data:image/svg+xml;base64,`;

createLogo('kab-logo', logo_base64);
createLogo('women-logo', women_logo);
var aside = document.querySelector("aside");
var menu_btn = document.querySelector(".menu-btn");
var close_btn = document.querySelector(".close");
var themeToggler = document.querySelector(".theme-toggler");
var sidebar_btn = document.querySelectorAll('.sidebar button');

for (let i = 0; i < sidebar_btn.length; i++) {
    const element = sidebar_btn[i];
    element.onclick = () => {
        element.classList.toggle('active-btn');
    }   
}

menu_btn.addEventListener("click", ()=> {
    aside.style.display = 'block'
})
close_btn.addEventListener("click", ()=> {
    aside.style.display = 'none'
})

themeToggler.addEventListener('click', ()=> {
    document.body.classList.toggle('dark-theme-variables');
    // document.querySelector('.add-product i').classList.toggle('white-icon')
    x =themeToggler.querySelectorAll('i');
    y = document.querySelectorAll('.sidebar i, kab-logo, .add-icon, .dark');
    for (let i = 0; i < y.length; i++) {
        const element = y[i];
        // document.querySelector('kab-logo').style.filter = "invert(100%)";
        element.classList.toggle('white-icon');
    }
    for (let i = 0; i < x.length; i++) {
        const element = x[i];
        x[i].classList.toggle('active');
    }
    
})

var add_product = document.querySelector('.add-product');
add_product.addEventListener("hover",()=>{
    if (document.body.classList.contains('dark-theme-variables')) {
        this.querySelector('div.i').classList.toggle('white-icon');
    }
})

// Show the empty message
const observer = new MutationObserver(function(mutations_list) {
	mutations_list.forEach(function(mutation) {
		mutation.removedNodes.forEach(function(removed_node) {
            if (removed_node[0] == "empty-table") {
                document.querySelector('.recent-orders').appendChild(removed_node)
            }
            document.querySelector(".empty-table").style.display = "flex";
            if (!document.querySelector('table')) {
                document.querySelector('.checking').removeChild(document.querySelector('.checking a'));
                document.querySelector(".empty-table").style.display = "flex";
            }
		});
        console.clear();
	});
});
observer.observe(document.querySelector(".recent-orders"), { subtree: true, childList: true });

if (!document.querySelector('table')) {
    document.querySelector('.empty-table').style.display = "flex";
}